import React from "react";
import Navbar from "./Section/Header";
import { BrowserRouter as Router, Routes, Route } from "react-router-dom";

const HomePage = () => {
  return (
    <>
      <Router>
        <Routes>
          <Route path="/" exact={true} element={<Navbar />} />
        </Routes>
      </Router>
    </>
  );
};

export default HomePage;
